import React from 'react';
import FlipCard from '../src/Components/Cards/FlipCard';
import ProfileBack from '../src/Components/Cards/Profile/ProfileBack';
import ProfileFront from '../src/Components/Cards/Profile/ProfileFront';
import AsideMenu from '../Menus/AsideMenu';
const Aside = () => {
    return (
        <div class="container">
            <div class="logo">

            </div>
            <div class="profile">
                <FlipCard frontContent={<ProfileFront title="FRONT"/>} backContent={<ProfileBack title="BACK"/>}  />
            </div>
            <div class="menu">
                <AsideMenu />
            </div>
        </div>
    );
}

export default Aside;
